            return false;
        }
        case LOAD_THE_STUFF_TODO_PAINFUL_FAILURE:{
            return false;
        }
        default:
            return state;
    }
}*/
//another reducer
export const reduceTodo= (state =selectorInitialState, action)=>{
    const {type, payload }=action;

    switch(type){
        //before thunk and server
        /*case CREATE_THE_STUFF_TODO:{
            const {text}=payload;
            const newStuffWithTextTodo={
                text,
                isCompleted:false
